# https://leetcode.com/problems/jump-game-ii/description/
class Solution(object):
    def jump_old(self, nums):
        """
        :type nums: List[int]
        :rtype: int
        """
        if len(nums) <= 1: return 0
        # BFS + GREEDY
        # We just need to get the farthest reach
        queue = [0]
        jump = 0
        while len(queue) > 0:
            jump += 1
            queue = self.BFS(nums, queue)
        return jump

    def BFS(self, nums, queue):
        new_queue = []
        while len(queue) > 0:
            cur_idx = queue.pop(0)
            cur_val = nums[cur_idx]
            for i in range(1, cur_val + 1):
                jump_to_idx = cur_idx + i
                if jump_to_idx == len(nums) - 1:
                    return []
                elif jump_to_idx < len(nums) - 1:
                    new_queue.append(jump_to_idx)
        return new_queue

    def jump(self, nums):
        jumps = 0
        cur_index = 0
        cur_farthest_index = 0
        next_farthest_index = 0
        while cur_farthest_index - cur_index + 1 > 0:
            # Fast Forward if nums[cur_index] = 1
            while cur_index < len(nums) - 1 and nums[cur_index] == 1:
                cur_index += 1
                cur_farthest_index += 1
                jumps += 1

            if cur_index >= len(nums) - 1:
                break
            jumps += 1
            print("cur_farthest_index = %d" % cur_farthest_index)
            for i in xrange(cur_index, cur_farthest_index + 1):
                next_farthest_index = max(next_farthest_index, i + nums[i])
                if next_farthest_index >= len(nums) - 1:
                    return jumps
            cur_farthest_index = next_farthest_index

        return jumps

